import React from 'react'
import ReactDOM from 'react-dom'
import Stories from './Storie'


export default (props) => {

	const hand = {cursor:props.cursor || 'pointer'}
	
	return(
	<div className="Profile">

			<div className="Profilefoto" onClick={loadStorie} style={hand}></div>

			<div className="ProfileText">
				<h2>{props.nome}</h2>
				<p>{props.text}</p>
				<br/><br/>
				<span>doe bitcoin:</span><br/>
				<span>{props.bitcoin}</span>
			</div>
	</div>
	)
}


 export function loadStorie(){ReactDOM.render(<Stories button="X" />,document.getElementById('root'))}
